(148, '{"address_components":[{"long_name":"New Delhi","short_name":"New Delhi","types":["locality","political"]},{"long_name":"Indira Gandhi International Airport","short_name":"Indira Gandhi International Airport","types":["sublocality_level_1","sublocality","political"]},{"long_name":"South West Delhi","short_name":"South West Delhi","types":["administrative_area_level_2","political"]},{"long_name":"Delhi","short_name":"DL","types":["administrative_area_level_1","political"]},{"long_name":"India","short_name":"IN","types":["country","political"]},{"long_name":"110037","short_name":"110037","types":["postal_code"]}],"adr_address":"<span class=\\"extended-address\\">Indira Gandhi International Airport<\\/span>, <span class=\\"locality\\">New Delhi<\\/span>, <span class=\\"region\\">Delhi<\\/span> <span class=\\"postal-code\\">110037<\\/span>, <span class=\\"country-name\\">India<\\/span>","formatted_address":"Indira Gandhi International Airport, New Delhi, Delhi 110037, India","formatted_phone_number":"0124 337 6000","geometry":{"location":{"lat":28.5561624,"lng":77.0999578}},"icon":"https:\\/\\/maps.gstatic.com\\/mapfiles\\/place_api\\/icons\\/airport-71.png","id":"f8c62b9a0d5c2c469e47ab292585a65b2ec6c3ba","international_phone_number":"+91 124 337 6000","name":"Indira Gandhi International Airport","photos":[{"height":2232,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/102414412738885638492\\/photos\\">Kishore Lukka<\\/a>"],"width":3968},{"height":612,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/116005537088265037619\\/photos\\">Dileep Unnikrishnan<\\/a>"],"width":816},{"height":1224,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/115104230851486025822\\/photos\\">Dr Sein Win<\\/a>"],"width":1632},{"height":3672,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/108837428016438949189\\/photos\\">Pablo Costa Tirado<\\/a>"],"width":4896},{"height":612,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/116503946314162686521\\/photos\\">Rajindar Singh<\\/a>"],"width":816},{"height":960,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/107527604686913330794\\/photos\\">basant kumar<\\/a>"],"width":1280},{"height":2340,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/115199073421043779807\\/photos\\">Abhishek Dhiman<\\/a>"],"width":4160},{"height":728,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/112988722856500845054\\/photos\\">Saneh Kharb<\\/a>"],"width":1296},{"height":612,"html_attributions":["<a href=\\"https:\\/\\/maps.google.com\\/maps\\/contrib\\/116005537088265037619\\/photos\\">Dileep Unnikrishnan<\\/a>"],"width":816},{"height":1224,"html_attributions":["From a Google User"],"width":1632}],"place_id":"ChIJiS0q_IUbDTkRne1DLBh2874","rating":4.5,"reference":"CoQBdwAAAIY2wVvr7m53Bo7UpNSvDAVYzuZy8Rt2O-ydW6LJqzYCN_97pub0JhJmhPZ-l5MZNq76zNmMHZb8gZRddCh1LuFrLVGrgqCfCtt6Uw6V5KreWRY1HaXM-qPLzfwwqHCS_JuqvtU1m62sCtIYuxuVrmLO0Ak1eIVtR492mfRNA-ZFEhDZKAuCTMgBlykB5dVmD78BGhSmJ-CH9NwkbYryB3ptM2cGVAFXPw","reviews":[{"aspects":[{"rating":3,"type":"overall"}],"author_name":"Dilip khandal","author_url":"https:\\/\\/plus.google.com\\/115253112546195815768","language":"en","profile_photo_url":"\\/\\/lh6.googleusercontent.com\\/-f9wYbf8sGVs\\/AAAAAAAAAAI\\/AAAAAAAAJbM\\/-eLrLX-aMhU\\/photo.jpg","rating":5,"text":"India is moving ahead and Indira Gandhi international airport is symbol of this growth. Well maintained clean and cool place. Everything to make visit comfortable. Facilities available at all corners, which is not common in India. Vending machine, food court and counter with all variety and choices.    Happy tour. ","time":1465030352},{"aspects":[{"rating":0,"type":"overall"}],"author_name":"Osama Moshet","author_url":"https:\\/\\/plus.google.com\\/114662950619603266236","language":"en","profile_photo_url":"\\/\\/lh3.googleusercontent.com\\/--GB8QVBSRlU\\/AAAAAAAAAAI\\/AAAAAAAAZbI\\/EoyFDqaIEvA\\/photo.jpg","rating":2,"text":"Arrival was OK. \\nLuckily Immigration was not crowded. Departure was a different story, long queues that don''t move. Almost missed our flight. \\nFlight was delayed 40 minutes. Not a smiling face to welcome you or to say goodbye.\\nAirport is clean, needed more signs, were not able to locate our airline check in without running around and asking. \\nDo they really want visitors?!!","time":1463568357},{"aspects":[{"rating":3,"type":"overall"}],"author_name":"tanuj thakur","author_url":"https:\\/\\/plus.google.com\\/117825998360427122052","language":"en","profile_photo_url":"\\/\\/lh4.googleusercontent.com\\/-2d43_deMja8\\/AAAAAAAAAAI\\/AAAAAAAAACI\\/hd7mkgc7J5E\\/photo.jpg","rating":5,"text":"my experience is very excellent in delhi airport\\ni apperciate the delhi airport soo much.","time":1465824288},{"aspects":[{"rating":0,"type":"overall"}],"author_name":"Manish Jain","author_url":"https:\\/\\/plus.google.com\\/111006274736476841699","language":"en","profile_photo_url":"\\/\\/lh5.googleusercontent.com\\/-85yxackd-z4\\/AAAAAAAAAAI\\/AAAAAAAAP_I\\/BJunOSnwlGw\\/photo.jpg","rating":1,"text":"Overall, our experience at the airport was extremely negative. We arrived at the international terminal (T3) around 2:30am and had to transit to domestic terminal (T1) to catch a domestic flight at 6:30am. With 3.5 hours in between our international arrival and domestic flight, we assumed that we will be able to catch the domestic flight, but unfortunately we missed our domestic connection. \\n\\nThe bad experience started with a bus-transfer from T3 to T1 which took over 1hr20min from the time we existed customs to the time we arrived at the checkin counter in domestic terminal. Not only that, the bus driver\\/conductor ended up asking us (and other passengers) for money and when we refused to pay, he threatened to drop us off the bus. Whereas this inter-terminal connection is supposed to be free. \\n\\nThe checkin process was slow due to a long line, and since the baggage allowance was lower on domestic flight, it was made even slower as we had to go into another line to pay the extra baggage fee before checkin in. The whole checkin took slightly over 40min. And then the security took another 30 mins.  At the end of this endless queues and waiting, we arrived at the departure gate about 15 min prior to flight''s scheduled departure, but the airlines have a policy of closing the gate 30 mins before departure. So, we were not allowed to board the flight. I was mad as hell at this point, but my wife who was traveling with me to India on her first trip to India nearly broke down and couldn''t understand how the entire process be so slow.\\n\\nExiting the post-security departure to go back to checkin counter to rebook on to later flight was another crazy-weird story. One would expect that we could walk back to checkin area, but that isn''t the case. You have to be escorted by an airline official who will first gather many passengers that have missed their flight, walk them to the security area (the same security checkpoint that one stands in line before the departure gates), and write down the passengers details one by one manually in a notebook before letting you go. Once in the checkin area, we managed to rebook onto a later flight by different airline, but still had to wait another 45 mins before we could get our luggage back from the airline who flight we had missed. In other words, from the time we missed the flight to the time that we received our luggage was another 1hr15 mins, and then we had to go through the same checkin\\/pay extra luggage\\/security before we could board onto another flight. \\n\\nBy the time we got on our domestic flight, it had been a total of 6+ hours since we had landed in T3 terminal. We hadn''t sat down for a single moment in all this time, and had been under constant stress of moving  in different queues or waiting on\\/for something.  \\n\\nOur experience at Delhi airport was in sharp contrast to our smooth sailing at Shanghai airport (we were flying into Delhi from Shanghai). We had a total of 4 hours at Shanghai airport. We managed to drop off our luggage at baggage storage area (checkin counters would open only 3 hours prior to flight), walk to Maglev trainstop, take the Maglev to Longyang stations, get on to a local train for 3 stops to Lujuazui, step out, take some photos with WTC etc in background for 20mins and take the same route back to airport, and checkin with some time to spare in departure lounge. \\n\\nThere are many things to say and infer, but it suffices to simply say that it is a tale of two different worlds!!","time":1463608939},{"aspects":[{"rating":0,"type":"overall"}],"author_name":"Mildpace K","author_url":"https:\\/\\/plus.google.com\\/110143930483791541773","language":"en","rating":1,"text":"Corrupt immigration staff at immigration check point at the \\"Indira gandhi International airport, India\\"\\n\\nDelhi is capital city of India. I did not expect corruption at the airport, at least not openly, at least not at immigration check point. \\n\\nI had to transfer flights, going from hyderabad -delhi-london. I had to go through immigration check. I had to fill the form, and then stand in line. There were about 4 counters, and one line. One officer (in uniform), got some people and had put them in middle of line. One person behind them asked why are doing it. The officer very rudely said, \\"let me finish the call\\". Upon request other officer interfered. The officers even had verbal argument. There was such confusion, just to maintain simple line to immigration. I believe the first officer took few hundred rupees, to fill immigration forms and put people in middle of line. That was so disgusting. I did not expect it at all. what if the immigration officer took some money to let a terrorist in. Its a security issue. What a shame for India, for such things to happen in capital city.","time":1463514536}],"scope":"GOOGLE","types":["airport","point_of_interest","establishment"],"url":"https:\\/\\/maps.google.com\\/?cid=13759471132740939165","utc_offset":330,"vicinity":"New Delhi","website":"http:\\/\\/www.newdelhiairport.in\\/","html_attributions":[]}', 'Indira Gandhi International Airport, New Delhi, Delhi 110037, India', NULL, '2016-06-15 05:09:01', '2016-06-15 05:09:01'),
